import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import Card from './warehouse-card';

function Warehouse() {
	let [warehouse, setWarehouse] = useState({
		name: '',
		address: '',
		type: '',
		_id: null,
	});
	let id = useParams().id;

	useEffect(() => {
		fetch(`warehouse/${id}`).then((res) => {
			res.json().then((data) => {
				console.log(data);
				setWarehouse(data);
			});
		});
	}, [warehouse._id]);

	if (warehouse._id == null) {
		return <div>Loading...</div>;
	} else {
		return <Card warehouse={warehouse} />;
	}
}

export default Warehouse;
